#define V 225 // Number of vertices in the graph
#define MAX_CITY_NAME_LENGTH 100

// Structure to represent a city
struct City {
    int number;
    char name[MAX_CITY_NAME_LENGTH];
};

// A utility function to find the vertex with minimum distance value
int minDistance(int dist[], bool sptSet[]) {
    int min = INT_MAX, min_index;
	int v = 0;
    for ( v = 0; v < V; v++) {
        if (sptSet[v] == false && dist[v] <= min) {
            min = dist[v];
            min_index = v;
        }
    }

    return min_index;
}

// Function to print the path from the source to the destination
void printPath(int parent[], int j) {
    // Base case
    if (parent[j] == -1) {
        printf("%d,", j);
        return;
    }

    printPath(parent, parent[j]);
	//printf("Enteres recursion\n");
    printf("%d,", j);
}



// Function to print the solution and find the nodes traversed
void printSolution(int dist[], int parent[], int src, int target) {
    struct City city;
    int path[V]; // Array to store the path

    // Trace back the path from target to source
    int current = target;
    int index = 0;
    while (current != src) {
        path[index++] = current;
        current = parent[current];
    }
    path[index++] = src;
    path[index] = -1; // Mark the end of the path
	//printf("Solution\n");
    // Print the solution (shortest distance and path)
    printf(" %d,", dist[target]);
    //printf("Path: ");
    //printf("Print solution each\n");
    printPath(parent, target);
    printf("\n");

    /*// Print the nodes traversed
    printf("Nodes traversed: ");
    int i = 0;
    for (i = index - 1; i >= 0; i--) {
        printf("%d ", path[i]);
    }
    printf("\n");*/
}

// Function that implements Dijkstra's algorithm for a graph represented using
// adjacency matrix representation
void dijkstra(int graph[V][V], int src, int target) {
    int dist[V]; // The output array. dist[i] will hold the shortest distance from src to i
    bool sptSet[V]; // sptSet[i] will be true if vertex i is included in the shortest path tree or shortest distance from src to i is finalized
    int parent[V]; // Parent array to store shortest path tree

    // Initialize all distances as INFINITE and stpSet[] as false
    int i = 0;
    for (i = 0; i < V; i++) {
        dist[i] = INT_MAX;
        sptSet[i] = false;
        parent[i] = -1;
    }

    // Distance of source vertex from itself is always 0
    dist[src] = 0;
	int count = 0;
    // Find shortest path for all vertices
    for (count = 0; count < V - 1; count++) {
        // Pick the minimum distance vertex from the set of vertices not yet processed
        int u = minDistance(dist, sptSet);

        // Mark the picked vertex as processed
        sptSet[u] = true;

        // Update dist value of the adjacent vertices of the picked vertex
        int v = 0;
        for ( v = 0; v < V; v++) {
            if (!sptSet[v] && graph[u][v] && dist[u] != INT_MAX && dist[u] + graph[u][v] < dist[v]) {
                dist[v] = dist[u] + graph[u][v];
                parent[v] = u;
            }
        }
    }
	//printf("Dijkstra\n");
    // Print the solution and find the nodes traversed
    printSolution(dist, parent, src, target);
}

